import React, { useEffect, useState } from "react";
import { useNavigate } from "react-router-dom";
import InnerNav from "../NavBar/InnerNav";
import { getSessionCookie } from "../auth/sessions";
import domainName from "../../domain";

function Assets() {
  const [assets, setAssets] = useState([{ nickname: "", number: "" }]);
  const domain = domainName;

  //  On Load fetch the users assets loaded in the db
  useEffect(() => {
    fetch(`${domain}/assets`, {
      method: "GET",
      headers: {
        "x-access-token": getSessionCookie().token,
        "ngrok-skip-browser-warning": "skip",
      },
    })
      .then((response) => {
        if (response.status === 200) {
          return response.json();
        } else throw new Error("error");
      })
      .then((data) => {
        setAssets(data.assets);
        console.log(data);
      });
  }, []);

  return (
    <div className="grid">
      <InnerNav />
      <div id="Assets">
        <h1>Create and View Assets!</h1>
        <h3>Current Assets</h3>
        <div className="tableDiv">
          <table id="demTable">
            <thead>
              <tr>
                <th>Asset Name</th>
                <th>Client</th>
                <th>Asset Phone Number</th>
                <th>Asset Email</th>
                <th>Edit</th>
                <th>Delete</th>
              </tr>
            </thead>
            <tbody>
              {assets.map((asset) => {
                return (
                  <tr>
                    <td>{asset.name}</td>
                    <td>{asset.client_id}</td>
                    <td>{asset.number}</td>
                    <td>{asset.email}</td>
                    <td>Edit</td>
                    <td>Delete</td>
                  </tr>
                );
              })}
            </tbody>
          </table>
        </div>
        <form>
          <div>
            <label>Asset: </label>
            <input
              type="text"
              value={asset}
              onChange={(e) => setNickname(e.target.value)}
            />
          </div>
          <div>
            <label>Phone Number: </label>
            <input
              type="text"
              value={newNumber}
              onChange={(e) => setNewNumber(e.target.value)}
            />
          </div>
          <button
            type="button"
            onClick={() => {
              addNewNum(nickname, newNumber)
                // TODO re render the component
                .then(() => navigate("/Console"))
                .catch((err) => setErrormsg(err.message));
            }}
          >
            Submit
          </button>
        </form>
      </div>
    </div>
  );
}

export default Assets;
